[{"location":"","page":"Home","title":"Home","text":"CurrentModule = TropicalCyclonePotentialIntensity","category":"page"},{"location":"#TropicalCyclonePotentialIntensity","page":"Home","title":"TropicalCyclonePotentialIntensity","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for TropicalCyclonePotentialIntensity.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [TropicalCyclonePotentialIntensity]","category":"page"},{"location":"#TropicalCyclonePotentialIntensity.find_root_newton_raphson-Tuple{Any, Any}","page":"Home","title":"TropicalCyclonePotentialIntensity.find_root_newton_raphson","text":"approximate_t_newton_raphson(tguess,penv,target_entropy)\n\nGiven a parcel's total entropy sparcel and a pressure level P, use the Newton-Raphson method to find T⋆ such that s(T⋆,P) = sparcel. It assumes reversible moist process. Total entropy of the parcel before condensation:  s = (cpd + rtcl)ln(T) - Rdln(pd) + Lvr/T - rRvln(H) : rt is total water (vapor plus liquid) \n\n\n\n\n\n","category":"method"},{"location":"#TropicalCyclonePotentialIntensity.get_buoyancy_of_lifted_parcel","page":"Home","title":"TropicalCyclonePotentialIntensity.get_buoyancy_of_lifted_parcel","text":"get_buoyancy_of_lifted_parcel(tparcel,rparcel,pparcel,t,r,p,ptop=50)\n\n\n\n\n\n","category":"function"},{"location":"#TropicalCyclonePotentialIntensity.get_lifted_condensation_level-Tuple{Any, Any, Any}","page":"Home","title":"TropicalCyclonePotentialIntensity.get_lifted_condensation_level","text":"get_lifted_condensation_level(temperature,relative_humidity,pressure)\n\nReceive temperature in Kelvin, relative humidity (unitless) and pressure (hPa) and compute the lifted condensation level based on Emanuel's E94 \"calcsound.f\" code at http://texmex.mit.edu/pub/emanuel/BOOK/\n\n\n\n\n\n","category":"method"},{"location":"#TropicalCyclonePotentialIntensity.get_minimum_pressure_of_tropical_cyclone-NTuple{5, Any}","page":"Home","title":"TropicalCyclonePotentialIntensity.get_minimum_pressure_of_tropical_cyclone","text":"get_minimum_pressure_of_tropical_cyclone(sea_surface_temp,sea_surface_pressure, pressure, temperature, mixing_ratio; ckovercd = 0.9, reversible_ascent=1, dissipative_heating = true)\n\ntemperatures in kelvin\n\n\n\n\n\n","category":"method"},{"location":"#TropicalCyclonePotentialIntensity.get_mixing_ratio-Tuple{Any, Any}","page":"Home","title":"TropicalCyclonePotentialIntensity.get_mixing_ratio","text":"get_mixing_ratio(water_vapor_partial_pressure,env_pressure)\n\nReceive a water vapor mixing ratio (unitless g/g) and environmental pressure and compute the partial pressure of water vapor in the same units as the incoming pressure.\n\n\n\n\n\n","category":"method"},{"location":"#TropicalCyclonePotentialIntensity.get_partial_vapor_pressure-Tuple{Any, Any}","page":"Home","title":"TropicalCyclonePotentialIntensity.get_partial_vapor_pressure","text":"get_partial_vapor_pressure(mixing_ratio,pressure)\n\nReceive a water vapor mixing ratio (unitless g/g) and environmental pressure and compute the partial pressure of water vapor in the same units as the input pressure.\n\n\n\n\n\n","category":"method"},{"location":"#TropicalCyclonePotentialIntensity.get_potential_temperature-Tuple{Any, Any, Any}","page":"Home","title":"TropicalCyclonePotentialIntensity.get_potential_temperature","text":"get_potential_temperature(temperature, pressure, reference_pressure)\n\nCompute potential temperature from temperature and pressure.\n\n\n\n\n\n","category":"method"},{"location":"#TropicalCyclonePotentialIntensity.get_saturation_vapor_pressure-Tuple{Any}","page":"Home","title":"TropicalCyclonePotentialIntensity.get_saturation_vapor_pressure","text":"get_saturation_vapor_pressure(T)\n\nReceive temperature T in Kelvin and compute the saturation vapor pressure in hPa from the August-Roche-Magnus formula that approximates the solution to the Clausius-Clapeyron relationship (Wikipedia contributors. (2020, December 19). Clausius–Clapeyron relation. In Wikipedia, The Free Encyclopedia. Retrieved 06:57, December 20, 2020, from https://en.wikipedia.org/w/index.php?title=Clausius%E2%80%93Clapeyron_relation&oldid=995159175)\n\n\n\n\n\n","category":"method"},{"location":"#TropicalCyclonePotentialIntensity.get_specific_entropy-Tuple{Any, Any, Any}","page":"Home","title":"TropicalCyclonePotentialIntensity.get_specific_entropy","text":"get_specific_entropy(temperature,mixing_ratio,pressure)\n\nReceive temperature in Kelvin, water vapor mixing ratio (unitless g/g) and pressure (hPa) and compute the specific entropy of a parcel using equation in Emmanuel's (E94, EQN. 4.5.9)\n\n\n\n\n\n","category":"method"},{"location":"#TropicalCyclonePotentialIntensity.get_specific_entropy_emanuel-Tuple{Any, Any, Any}","page":"Home","title":"TropicalCyclonePotentialIntensity.get_specific_entropy_emanuel","text":"get_specific_entropy_emanuel(temperature,mixing_ratio,pressure)\n\nReceive temperature in Kelvin, water vapor mixing ratio (unitless g/g) and pressure (hPa) and compute the specific entropy of a parcel using equation in Emmanuel's (E94, EQN. 4.5.9)\n\n\n\n\n\n","category":"method"},{"location":"#TropicalCyclonePotentialIntensity.get_virtual_temperature-Tuple{Any, Any, Any}","page":"Home","title":"TropicalCyclonePotentialIntensity.get_virtual_temperature","text":"get_virtual_temperature(temperature,mixing_ratio_total_water,mixing_ratio_water_vapor)\n\nReceive temperature (K) and mixing ratios of total water and water vapor (unitless g/g) and compute the virtual temperature\n\n\n\n\n\n","category":"method"},{"location":"#TropicalCyclonePotentialIntensity.get_virtual_temperature-Tuple{Any, Any}","page":"Home","title":"TropicalCyclonePotentialIntensity.get_virtual_temperature","text":"get_virtual_temperature(temperature, specific_humidity)\n\nCompute virtual temperature from temperature and specific humidity.\n\n\n\n\n\n","category":"method"},{"location":"#TropicalCyclonePotentialIntensity.mixing_ratio_to_specific_humidity-Tuple{Any}","page":"Home","title":"TropicalCyclonePotentialIntensity.mixing_ratio_to_specific_humidity","text":"mixing_ratio_to_specific_humidity(mixing_ratio)\n\nTake a mixing ratio (unitless g/g) and return a specific humidity\n\n\n\n\n\n","category":"method"},{"location":"#TropicalCyclonePotentialIntensity.specific_humidity_to_mixing_ratio-Tuple{Any}","page":"Home","title":"TropicalCyclonePotentialIntensity.specific_humidity_to_mixing_ratio","text":"specific_humidity_to_mixing_ratio(specific_humidity)\n\nTake a specific humidity (unitless g/g) and return a mixing ratio\n\n\n\n\n\n","category":"method"},{"location":"#TropicalCyclonePotentialIntensity.∂specific_entropy_∂temp-Tuple{Any, Any}","page":"Home","title":"TropicalCyclonePotentialIntensity.∂specific_entropy_∂temp","text":"\n\n\n\n","category":"method"}]
